import React from 'react';

import './custom-button.styles.scss';

export const CustomButton = ({children, isGoogleSignIn, ...otherProps}) => {
    return (
        <button
        className={`${isGoogleSignIn ? 'google-sign-in': '' }}'ustom-button'`}
        {...otherProps}
        >
            {children}
        </button>
    )
};
